First, combine like terms within each parentheses:

First set of parentheses: -21*x + 69*x = 48*x;
Second set of parentheses: 76*x -53*x = 23*x;
Third set of parentheses: 12*x -33*x = -21*x;
Fourth set of parentheses: 57*x + 76*x = 133*x = 33*x (modulo 100).

Next, combine the results of the four sets of parentheses:

48*x + 23*x -21*x + 33*x = 83*x.
